let ProfileCreateComponent = class ProfileCreateComponent {
    constructor(myFundiService, httpClient) {
        this.myFundiService = myFundiService;
        this.httpClient = httpClient;
        this.userDetails = {};
        this.profile = {
            fundiProfileId: 0,
            userId: "",
            user: null,
            profileSummary: "",
            profileImageUrl: "",
            skills: "",
            usedPowerTools: "",
            fundiProfileCvUrl: "",
            addressId: 0
        };
    }
    ngOnInit() {
        this.userDetails = JSON.parse(localStorage.getItem("userDetails"));
        this.userRoles = JSON.parse(localStorage.getItem("userRoles"));
        let userGuidObs = this.myFundiService.GetUserGuidId(this.userDetails.username);
        userGuidObs.map((q) => {
            this.userGuidId = q;
        }).subscribe();
        let resObs = this.myFundiService.GetFundiProfile(this.userDetails.username);
        resObs.map((fundiProf) => {
            if (fundiProf) {
                this.profile = fundiProf;
                let curAddObs = this.myFundiService.GetAddressById(fundiProf.addressId);
                curAddObs.map((q) => {
                    this.address = q;
                }).subscribe();
            }
            else {
                this.profile = {
                    fundiProfileId: 0,
                    user: null,
                    userId: "",
                    profileSummary: "",
                    profileImageUrl: "",
                    skills: "",
                    usedPowerTools: "",
                    fundiProfileCvUrl: "",
                    addressId: 0
                };
            }
        }).subscribe();
    }
    handleProfileCV(files) {
        this.profileCV = files.item(0);
    }
    handleProfileImage(files) {
        this.profileImage = files.item(0);
    }
    uploadFundiCV() {
        //let busyGif: HTMLDivElement = document.querySelector("div#loadingProfileCV");
        //busyGif.style.display = 'block';
        let url = "/FundiProfile/SaveFundiCV";
        let formData = new FormData();
        formData.append("fundiProfileCv", this.profileCV);
        formData.append("username", this.userDetails.username);
        this.httpClient.post(url, formData).map((res) => {
            alert(res.message);
        }).subscribe();
    }
    uploadProfileImage() {
        //let busyGif: HTMLDivElement = document.querySelector("div#loadingProfileImage");
        //busyGif.style.display = 'block';
        let url = "/FundiProfile/SaveFundiProfileImage";
        let formData = new FormData();
        formData.append("profileImage", this.profileImage);
        formData.append("username", this.userDetails.username);
        this.httpClient.post(url, formData).map((res) => {
            alert(res.message);
        }).subscribe();
        ;
    }
    saveProfile() {
        this.profile.userId = this.userGuidId;
        let profileObs = this.myFundiService.SaveProfile(this.profile);
        profileObs.map((res) => {
            alert(res.message);
        }).subscribe();
    }
    getSelectedAddress(addressId) {
        this.profile.addressId = addressId;
    }
};
